import React from 'react';
import {SafeAreaView, Text} from "react-native";

const CreateEventScreen = (props) => {
  return(
    <SafeAreaView>
      <Text>CreateEventPage</Text>
    </SafeAreaView>
  )
};

export default CreateEventScreen;
